// ================== SoftMax: softmax ================== //
// SoftMax for layer: softmax;

float *Linear(int batch_size, int input_size, int output_size, float *input, float *weight_transposed, float *bias)
{
    int i, j, k;

    // 为结果矩阵分配内存
    float *result = (float *)malloc(batch_size * output_size * sizeof(float));
    if (result == NULL)
    {
        printf("Error: Memory allocation failed.\n");
        return NULL;
    }

    // 初始化并执行矩阵乘法
    for (i = 0; i < batch_size; i++)
    {
        for (j = 0; j < output_size; j++)
        {
            result[i * output_size + j] = 0; // 初始化元素为0
            for (k = 0; k < input_size; k++)
            {
                result[i * output_size + j] += input[i * input_size + k] * weight_transposed[k * output_size + j];
            }
            result[i * output_size + j] += bias[j]; // 将偏置项加到结果中
        }
    }

    // 返回结果矩阵
    return result;
}
void Relu(int batch_size, int elements_length, float *input)
{
    for (int i = 0; i < batch_size * elements_length; i++)
    {
        if (input[i] < 0)
        {
            input[i] = 0;
        }
    }
}
void SoftMax(int batch_size, int elements_length, float *input)
{
    float max_value, sum_exp;

    // 逐行计算softmax
    for (int i = 0; i < batch_size; i++)
    {
        // 找到该行的最大值
        max_value = input[i * elements_length];
        for (int j = 1; j < elements_length; j++)
        {
            if (input[i * elements_length + j] > max_value)
            {
                max_value = input[i * elements_length + j];
            }
        }

        // 计算该行的指数和
        sum_exp = 0.0f;
        for (int j = 0; j < elements_length; j++)
        {
            input[i * elements_length + j] = exp(input[i * elements_length + j] - max_value);
            sum_exp += input[i * elements_length + j];
        }

        // 归一化得到softmax输出
        for (int j = 0; j < elements_length; j++)
        {
            input[i * elements_length + j] /= sum_exp;
        }
    }
}

float *forward(float input[], float output[])
{
    float *result_0 = (float *)malloc(sizeof(float) * 10);
    for (int i = 0; i < 10; i++)
    {
        result_0[i] = input[i];
    }
    // fc1_layer
    float *result_1 = Linear(1, 10, 32, result_0, fc1_weight_transposed, fc1_bias_transposed);
    free(result_0);
    // relu1_relu
    Relu(1, 32, result_1);
    // fc2_layer
    float *result_2 = Linear(1, 32, 32, result_1, fc2_weight_transposed, fc2_bias_transposed);
    free(result_1);
    // relu2_relu
    Relu(1, 32, result_2);
    // fc3_layer
    float *result_3 = Linear(1, 32, 64, result_2, fc3_weight_transposed, fc3_bias_transposed);
    free(result_2);
    // relu3_relu
    Relu(1, 64, result_3);
    // fc4_layer
    float *result_4 = Linear(1, 64, 64, result_3, fc4_weight_transposed, fc4_bias_transposed);
    free(result_3);
    // relu4_relu
    Relu(1, 64, result_4);
    // fc5_layer
    float *result_5 = Linear(1, 64, 20, result_4, fc5_weight_transposed, fc5_bias_transposed);
    free(result_4);
    // softmax_layer
    SoftMax(1, 20, result_5);
    for (int i = 0; i < 20; i++)
    {
        output[i] = result_5[i];
    }
    free(result_5);
}
